      SELECT DISTINCT - + col1, col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 - - col1 BETWEEN + col2 * + + 45 / + - col1 AND + col0;
  - name: tab2

outputs:
